B.a_D=new A.bS("Actividad: Habl\xe1ndole a la altura del vientre. Apunte la luz a la mitad del abdomen de la madre y d\xedgale: \u201cse prende\u201d manteni\xe9ndola as\xed por cinco segundos. Luego apague la l\xe1mpara por otros cinco segundos, y av\xedsele: \u201cse apaga\u201d. Se debe hacer esto en tres posiciones: arriba del vientre, en el centro y abajo; siguiendo una secuencia de 8 repeticiones. ",B.e,null)
B.a_E=new A.bS("Durante tu embarazo, los requerimientos de energ\xeda y nutrientes son necesarios para cubrir el crecimiento de los tejidos tuyos y de tu beb\xe8 y el incremento de gasto energ\xe9tico, debido al aumento del metabolismo basal y de la actividad f\xedsica. ",B.e,null)
