B.a_H=new A.bS("Actividad: Inicia apuntando tu vientre con la luz de la l\xe1mpara y d\xedganle al beb\xe9 que van a contar.\n Primero digan uno y presionen una vez, como si estuvieran imprimiendo su mano en el vientre\n Luego digan dos y presionen dos veces en el mismo lado, pero sobre diferentes sitios.\n Con la l\xe1mpara de mano, apunten el lugar donde est\xe1n presionando y sigan el trayecto de las presiones.",B.e,null)
B.a_I=new A.bS("Limita la cafe\xedna a menos de 200\xa0miligramos (mg) al d\xeda. Una taza de 8\xa0onzas (240\xa0mililitros, o ml) de caf\xe9 filtrado contiene alrededor de 95\xa0mg de cafe\xedna, esto puede producir un aumento de los latidos de tu coraz\xf3n y bajo peso al nacer de tu beb\xe9.",B.e,null)
B.a_J=new A.bS("Exponer al feto a est\xedmulos auditivos, como m\xfasica y la voz materna, a partir del quinto o sexto mes de embarazo, estimula su cerebro y favorece el desarrollo del lenguaje y la creatividad.",B.e,null)
B.a_K=new A.bS("Realizaremos una serie de preguntas para asegurarnos de que puedes iniciar la actividad f\xedsica sin problema.",B.e,null)
B.a_L=new A.bS("Todas las personas tenemos sue\xf1os y metas que deseamos alcanzar sin importar la edad o el momento en que nos encontremos.",B.e,null)
B.a_M=new A.bS("Actividad: Puedes cantarle a tu beb\xe9, leerle cuentos, ponerle m\xfasica suave y hablarle con amor. \nTambi\xe9n puedes pedirle a tu pareja que hable con el beb\xe9, para que se vaya familiarizando con su voz.",B.e,null)
B.a_N=new A.bS("La estimulaci\xf3n prenatal o intrauterina es un conjunto de t\xe9cnicas f\xedsicas y de relajaci\xf3n aplicadas por los padres durante la gestaci\xf3n, con el objetivo de favorecer el desarrollo del ni\xf1o o ni\xf1a por nacer, de acuerdo con su proceso natural.",B.e,null)
B.a_O=new A.bS("Es una oportunidad para reflexionar sobre lo que quieres para tu futuro. Te permite poder imaginar c\xf3mo lograr sus metas y ser una persona positiva.",B.e,null)
B.a_P=new A.bS("Son vitaminas y minerales que el cuerpo necesita en peque\xf1as cantidades para funcionar correctamente. Durante el embarazo, estos nutrientes son esenciales para el desarrollo saludable de tu beb\xe9 y tu bienestar.\nHierro\nAcido F\xf3lico\nCalcio\nYodo\nVitaminas",B.e,null)
B.a_Q=new A.bS("Beber alcohol durante el embarazo conlleva un mayor riesgo de aborto espont\xe1neo y muerte fetal intrauterina. El consumo de alcohol tambi\xe9n puede ocasionar el s\xedndrome alcoh\xf3lico fetal. Este s\xedndrome puede hacer que la cara no se forme correctamente y que el nivel de inteligencia sea inferior.",B.e,null)
